$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_5f8cdd85babf2f54b71a6edadd3cc477'] = 'este producto o su combinación se ha excluido de su alimentación como se define en la ficha Reglas de exclusión';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_33de4786ef798eb21fb17e358f2907b9'] = 'etiqueta “ID ” => Indica el identificador del artículo. El identificador de cada artículo debe ser único en su cuenta y no podrá reutilizarse en futuros flujos.';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_535327a84262bb09c699b7d8443aef71'] = 'etiqueta “TITLE” => Se trata del nombre del articulo. Es obligatorio.';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_105678f76b5b7f580cf7e42e342cfa8a'] = 'etiqueta “DESCRIPTION” => Indica la descripción del producto. Sirve para que el usuario pueda encontrar su artículo, indique los datos más relevantes de su producto, pero de un modo general.';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_0f89b407a76c4507108d902cb4cef43b'] = 'etiqueta “GOOGLE PRODUCT CATEGORY” => “Categoría de productos Google” (Google product category), indica la categoría del producto basándose en la clasificación de los productos que realiza Google.';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_0553038d1985c7647fe480d8f6408135'] = 'etiqueta “PRODUCT TYPE” => Indica la categoría del producto basándose en la clasificación que usted mismo haya establecido.';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_376652ea6cb436d7d31a89348baa5e78'] = 'etiqueta “LINK” => Indica la URL de la ficha del producto en su página web. ';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_21751997886728fb8dee8f8d97d5e301'] = 'etiqueta “IMAGE LINK” => Indica la URL de la imagen del artículo. Es la URL de la imagen asociada al producto. Cargue imágenes de gran tamaño de sus productos, no miniaturas.';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_1f94aa64616eadbdd5406b922c71f29d'] = 'etiqueta ”STATUS” => Condiciones o estado del artículo. Solo son posibles tres opciones: nuevo (new), ocasión (used) y restaurado (refurbished)';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_c2d82f0c8fab59f96fcb4ef4c8f58431'] = 'etiqueta “AVILABILITY” => Indica la disponibilidad del artículo. Para la etiqueta de disponibilidad solo existen cuatro términos posibles: en stock (in stock), disponible por encargo (available for order), no disponible (out of stock) y pedido anticipado (preorder)';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_0e27a71d34ae4a363529a379325ec82d'] = 'etiqueta “PRICE” => Indica el precio del artículo. El precio del artículo debe estar lo más visible posible.';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_43016d7329bf2ac3184f865f01d0d0dc'] = 'etiqueta “GTIN” => El GTIN (Global Trade Identification Number) es el código internacional del artículo';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_95c185f2c72bfcda8bb443aae59a5fe1'] = 'etiqueta “MARK” => Indica la marca del artículo. Obligatorio para todos los artículos excepto para los libros, los productos multimedia y los productos personalizados o en caso de que defina la referencia del fabricante (MPN) y el código EAN (GTIN)';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_f2dc5d0a47e95dbf13670358baf33777'] = 'etiqueta “MPN” => Indica la referencia del fabricante del articulo. Se trata de un código permanente que establece el fabricante para identificar su producto. Para una mayor precisión a la hora de identificar un producto, indique conjuntamente la marca y la referencia del fabricante';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_7fdc89119c57b600a00faae7a3cb193d'] = 'tag \"ADULT\" => The adult status assigned to your product listings through the ‘adult’ attribute affects where product listings can show';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_4f8b1378ba0b094ea6017609b24b8b81'] = 'etiqueta “GENDER” => Indica el género del artículo. Hay tres posibles opciones predefinidas: Hombre, Mujer y Unisex';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_89a5d525c96784178a1797abf4f996a5'] = 'etiqueta “AGE GROUP” => Para esta etiqueta, solo los dos siguientes términos son posibles: “adults” (adultos) y “kids” (niños)';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_828d5792f6e0420f89c85fe36b68ecbe'] = 'etiqueta “COLOR” => Esta etiqueta define el color o los colores principales de un artículo';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_b21faedada81d28249bacaa291bb1f64'] = 'etiqueta “SIZE” => Indica la talla o el tamaño del artículo';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_803d18ceedf37835dcac0f31abd8b3df'] = 'etiqueta “MATERIAL” => Material o tejido del que está hecho un producto';
