$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_3c8a80bbd741dae60b6ad04a417d4303'] = 'etiqueta “ITEM GROUP ID” => Los artículos con disponibilidad en diferente color, material, diseño y/o tamaño, deben tener un mismo identificador de grupo';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_91400488d34b0e6315c4ea1236545131'] = 'etiqueta “SHIPPING WEIGHT” => Establece el peso del producto con el objetivo de poder calcular los gastos de envío. Si usted ha establecido unas normas generales de envío basadas en el peso del paquete, esta etiqueta servirá para calcular automáticamente los gastos de envío del artículo';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_5e1299a0cca324dc27e1b078626a248b'] = 'etiqueta “SHIPPING” => Esta etiqueta realiza una estimación de los gastos de envío del producto. Cuando se establece esta etiqueta para un artículo, se invalidan los parámetros generales establecidos por Google Merchant Center para los envíos. Utilícelo si desea especificar los gastos de envío de un artículo concreto o para reemplazar la configuración establecida por Google Merchant Center para los envíos';
$_MODULE['<{gmerchantcenter}prestashop>module-tools_class_0837abe323d3774a16672202217f38e4'] = 'Google todavía se requieren títulos de su producto para ser no más de 150 caracteres de longitud';
