$_MODULE['<{gmerchantcenter}prestashop>basics_5e317d1aa73d288fdb4e729f971d675e'] = 'Escriba un breve prefijo para su tienda. Por ejemplo, si su tienda se llama \"Flores Martín\", introduzca “fm”. Esto es fundamental si pretende gestionar flujos para diversas tiendas diferentes a través de su cuenta de Google Merchant Center';
