$_MODULE['<{gmerchantcenter}prestashop>basics_d057f3b727af0fea800fecf8f541fc72'] = 'Esto sirve para determinar el número de productos tratados por ciclo AJAX o CRON. El valor por defecto es 200. Aumente este valor únicamente si dispone de un gran catálogo y tiene problemas de limitación con el servidor. De lo contrario, déjelo en 200. En cualquier caso, este valor no debe ser superior a 1000.';
