$_MODULE['<{gmerchantcenter}prestashop>basics_60958b322a722363c4925e373efc4bfc'] = 'Tenga cuidado: esta opción pondrá el título de su producto con el nombre de la categoría actual. Sin embargo, Google aún se requieren títulos de su producto para ser no más de 150 caracteres de longitud';
$_MODULE['<{gmerchantcenter}prestashop>basics_8ba4b6c0dcd32ef99ab0371a79133cbc'] = 'Tenga cuidado: esta opción pondrá el título de su producto con la marca. Sin embargo, Google aún se requieren títulos de su producto para ser no más de 150 caracteres de longitud';
$_MODULE['<{gmerchantcenter}prestashop>basics_05147e199cfbfc6e48d43e67ed65b194'] = 'Google rechazará sus flujos si los títulos de los productos contienen demasiadas letras MAYÚSCULAS. Esta función le permite solucionar el problema al dejar en mayúscula solo la primera letra del título. Si el nombre de la marca está incluido en su producto en mayúsculas porque es la denominación que el fabricante le ha asignado, la función será la de modificarlo. P. ej.: “Bolso de cuero LOUIS VUITTON”  pasará a ser “Bolso de cuero Louis Vuitton”';
$_MODULE['<{gmerchantcenter}prestashop>basics_36a2838a0bbf9e1fdabdbd642b418b25'] = '¿Cómo eliminar el exceso de mayúsculas en los títulos de los productos?';
