$_MODULE['<{gmerchantcenter}prestashop>body_595a03b56327eede7babaa769fc919e3'] = 'Es obligatorio que tenga la función PHP file_get_contents con la directiva PHP allow_url_fopen habilitada en php.ini, o bien tener la extensión PHP CURL instalada y habilitada en su servidor, con el objetivo de poder acceder al archivo a través de la página de Google. Por favor, póngase en contacto con su proveedor de alojamiento web. Si  ninguna de estas opciones está disponible en su servidor, usted no podrá hacer uso de este módulo.';
$_MODULE['<{gmerchantcenter}prestashop>body_5da4d5d23e25bb62c0c6d92154856bd5'] = 'Por motivos de rendimiento, este módulo no puede configurarse para un conjunto de tiendas. Es necesario configurar cada tienda de manera individual.';
$_MODULE['<{gmerchantcenter}prestashop>body_e99aa18a88797d79f717427148035bdc'] = 'Las unidades de peso de su back-office son incorrectas. Ir a Localización => Localización de PrestaShop 1.5, o bien a Preferencias => Localización de PrestaShop 1.2 a 1.4. Google sólo acepta las siguientes unidades: kg, g, lb y oz, escritas exactamente de este modo, en letras minúsculas.';
