$_MODULE['<{gmerchantcenter}prestashop>google-settings_65a896ae3d621b7275b29f212e109d32'] = 'Google Shopping tiene su propia división por categorías en cada país (aunque en algunos países coinciden). Por lo tanto, es necesario que las categorías estén establecidas correctamente para cada país o grupo de países. Por ejemplo, si usted quiere presentar sus productos en EE.UU. y el Reino Unido, debe ajustarlos a las categorías correspondientes en cada uno de ellos, excluyendo los países que desee. No obstante, tenga en cuenta que no todos los tipos de productos necesitan estar en dentro de una categoría Google. Ver http://www.google.com/support/merchants/bin/answer.py?answer=160081 para más información.';
$_MODULE['<{gmerchantcenter}prestashop>google-settings_c9ad036fba9346fd21a16a3380e85c98'] = 'Utilice la herramienta mostrada a continuación para administrar sus categorías Google. El icono del lápiz';
$_MODULE['<{gmerchantcenter}prestashop>google-settings_01b3623eecce0e973e95003987ca225a'] = 'le permite igualar sus categorías PrestaShop y Google. El icono \"cargar\"';
$_MODULE['<{gmerchantcenter}prestashop>google-settings_791d8625f3723830dcd02940d76e2277'] = 'le permite actualizar la base de datos de las categorías Google del módulo a través de la lista oficial de Google. En realidad, esto no es necesario, ya que Google no actualiza esta lista con demasiada frecuencia, pero si percibiera alguna diferencia entre las categorías propuestas y las que se muestran en http://www.google.com/support/merchants/bin/answer.py?answer=160081, podrá actualizar su base de datos.';
$_MODULE['<{gmerchantcenter}prestashop>google-settings_8839340a1536c71f728316742c8cb319'] = 'La actualización de sus categorías está en progreso';
$_MODULE['<{gmerchantcenter}prestashop>google-settings_5fdba3796d30c8b2b6fda478f14de86c'] = 'Integración de Google Analytics';
$_MODULE['<{gmerchantcenter}prestashop>google-settings_846857ff79f642ec1601be33c86f5ca5'] = 'Esta sección le permite añadir parámetros adicionales de URL en los enlaces de sus productos (utm_campaign, utm_source y utm_medium). Con ello conseguirá un mejor seguimiento de sus campañas Google Adwords  de “Product Listing Ads\" en su cuenta de Google Analytics. Si un parámetro está vacío, no se añadirá a la URL. Por favor, utilice solo números y letras, sin espacios. No obstante, puede utilizar los signos - o _.';
$_MODULE['<{gmerchantcenter}prestashop>google-settings_5a5d38f724b020227bc9c4caa61df61b'] = 'Nota: Si utiliza esta función, asegúrese de comprobar que los parámetros utm_campaign, utm_source y utm_medium no figuren como excluidos en el archivo robots.txt.';
